import { assets } from "./data";
import useExchange from "./useExchange";

const DepositsInterest = () => {
  const rates = useExchange();
  const timastamp = Date().getTime();
  return assets.deposits.map((item) => {
    console.log(`${item.amount} at ${timastamp}`);
  });
};

export default DepositsInterest;
